import React from "react";
import { Route, Routes } from 'react-router-dom'  // Step 3
import About from './About'
import Contact from './Contact'
import ERROR from './Error';
import Navbar from "./Navbar";

const App = () => {

    let Name = () => {
        return <h1>Name Page Is Activated</h1>
    }
    return (
        <>
            <Navbar />
            <Routes>
                <Route exact path="/" Component={() => <About name='About' />} />{/* Ish Tarrike se hum Props Pass kr skte hai  */}
                <Route exact path="/contact" Component={() => <Contact name='Nikal Yaha se' />} />
                <Route path="/contact/name" Component={Name} />
                <Route Component={ERROR} />
            </Routes>
        </>
    )
}


export default App;
